    false,nt"url": null,nt"notes": "A Landsat assisted vegetation map was prepared
    for Tetlin National Wildlife Refuge (925,000 acres). The refuge lies within the
    northern boreal subzone of eastern Alaska. Seven major classes and nineteen subclasses
    were recognized: forest (closed needleleaf, open needleleaf, needleleaf woodland,
    mixed, deciduous), deciduous scrub (lowland, alluvial, alpine/subalpine) dwarf scrub
    (prostrate dwarf scrub tundra, dwarf scrub-graminoid peatland), herb (graminoid
    marsh, aquatic forb), scarcely vegetated areas (scarcely vegetated screes, barren
    screes, scarcely vegetated floodplain, barren floodplain), water (clear, low sedimented,
    medium to high sedimented), and other areas (snow, cultural features).",nt"license_title":
